import React from "react";
import Logo from "../components/nyc_parks.png";

const styles = {
  card: {
    background: "#e8eaf6"
  },
  heading: {
    background: "#006400",
    maxHeight: 50,
    fontSize: "2.0rem",
    color: "white",
    padding: "0 10px",
    width: "auto"
  },
  login: {
    marginRight: 20,
    textAlign: "right",
  },
  logo: {
    maxHeight: 40,
    position: "relative",
    paddingBottom: "3px"
  }
};

function Navbar() {
  return (
    <div style={styles.card}>
      <row>
      <div style={styles.login}><a href="./login" > Login </a></div> 
      </row>
      <div style={styles.heading}>Welcome!<img src={Logo} alt="nyc_parks_logo" style={styles.logo}/></div>
    </div>
  );
}

export default Navbar;

